@phuluong:

Anh để HTML ở branch: ` feature-mekhoeconthongminh-upgrade-menu ` 

Em nhờ ai implement giúp anh nhé!

ALTER TABLE `2pro`.`order_trying` 
ADD COLUMN `cost` decimal(10, 2) NULL AFTER `quantity`;

ALTER TABLE `2pro`.`certificate_procedure` 
DROP COLUMN `product_id`,
CHANGE COLUMN `order_id` `certificate_id` int(11) NULL DEFAULT NULL AFTER `id`;

CREATE TABLE `product_n_certificate` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `certificate_id` bigint(20) DEFAULT NULL,
  `product_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
